import React from "react";

import { connect } from "react-redux";

const DifficultyButton = ({ level, name, getQuestions }) => {
  return (
    <button onClick={() => console.log(level)} className="button-difficulty">
      {name}
    </button>
  );
};

const mapStateToProps = (state) => {
  return state;
};

export default connect(mapStateToProps, {})(DifficultyButton);
